import React, { useState, useEffect } from 'react'
import Navbar from "./Navbar";
import "./assets/css/main.css"
import { StyleSheet, View, Text } from 'react-native'
import Validation from './SignUpValidation'
// import "../index.css"
import Axios from 'axios'
import { nanoid } from 'nanoid'


export default function SignUpPage({ navigation }) {
	const loadScene = () => {
		navigation.navigate('LoginPage');
	}

	const [values, setValues] = useState({
		name: '',
		email: '',
		password: '',
	})

	const [errors, setErrors] = useState({})

	const handleInput = (event) => {
		setValues(prev => ({...prev, [event.target.name]: [event.target.value]}))
	}

	const [notes, setNotes] = useState([
		{
			id: nanoid(),
			key: 'Зразок',
			text: 'Тут ключ',
			date: 'Місце для передавання ключа',
			today: '25/10/2023'
		},
	]);

	useEffect(() => {
		const savedNotes = JSON.parse(
			localStorage.getItem('noteslist')
		);

		if (savedNotes) {
			setNotes(savedNotes);
		}
	}, []);

	useEffect(() => {
		localStorage.setItem(
			'noteslist',
			JSON.stringify(notes)
		);
	}, [notes]);

	const session = localStorage.getItem('session')

	const handleSubmit = (event) => {
		event.preventDefault();
		setErrors(Validation(values));
		if(errors.name === "" && errors.email === "" && errors.password === "") {
			Axios.post("http://localhost:8081/signup", values)
			// .then(res => {

			// 	function s1() {
			// 		const session = localStorage.getItem('session')
			// 		localStorage.setItem('session', JSON.stringify(values))
			// 		localStorage.setItem('session', JSON.stringify(values))
			// 		const reg = {
			// 			session: session,
			// 			noteslist: noteslist,
			// 		}
			// 		const noteslist = localStorage.getItem('noteslist')

			// 		delete values['name']
			// 		localStorage.setItem('session', JSON.stringify(values))
			// 	}
			// 	setTimeout(s1, 200)

			// 	function s3() {
			// 	}
			// 	setTimeout(s3, 200)

			// 	function s4() {}
			// 	setTimeout(s4, 200)

			// 	function s5() {navigation.navigate('SignUpComplete')}
			// 	setTimeout(s5, 800)
			// })	
		}
	}

  return (
    <div id="page-wrapper">
      <Navbar />

      <div id="footer" style={{ background: "white" }}>
			<div className="container" style={{ background: "white", marginBottom: "-5%" }}>
				<div className="row">
					<section className="6u 12u(narrower) 12u$(mobilep)">
						<h3>Реєстрація нового користувача</h3>
						<form>
							<div className="row 50%">
								<div className="12u">
									<input type="email" name='email' id="email" placeholder="Ваша електронна пошта*" onChange={handleInput}/>
								</div>
							</div>
							<div className="row 50%">
								<div className="6u 12u(mobilep)">
									<input type="text" name='name' id="name" placeholder="Придумайте логін*" onChange={handleInput}/>
								</div>
								<div class="6u 12u(mobilep)">
									<input type="password" name='password' id="name" placeholder="Придумайте пароль*" onChange={handleInput}/>
								</div>
							</div>
							<div className="row 50%">
								<div className="12u">
									<ul className="actions" style={{ marginBottom: "20px" }} onClick={handleSubmit}>
										<li><input type="submit" className="button alt" value="Зареєструватися"/></li>
									</ul>
								</div>
							</div>
						</form>
						<p><b>Увага!</b> При створенні пароля ви маєте задіяти: маленькі літери, великі літери та цифри!</p>
					</section>

					<section className="6u 12u(narrower) 12u$(mobilep)">
						<h3>Рекомендації</h3>
						<p>1. При створенні паролю використайте не тільки звичайні літери, а й цифри та спеціальні символи.</p>
						<p>2. Не використовуйте паролі, які ви писали при реєстрації на інших ресурсах.</p>
						<p>3. Не зберігайте паролі на комп'ютері, планшеті, ноутбуці чи телефоні.</p>
					</section>
				</div>
			</div>
			<br></br>
			<br></br>
			<div className="copyright">
				<ul className="menu">
					<li>&copy; JavaScript. All rights reserved</li><li>Design: <a href="http://">Tockyj Bohdan</a></li>
				</ul>
        	</div>
		</div>
    </div>
  )
}
